import React from 'react'

const Contact = () => {

    let a = 100;


    let demo = ()=>{
        a = 200;
        console.log(a);
        console.log("*************");
    }


  return (
    <>
        <div>Contact</div>
        
        <button onClick={ demo } className='btn btn-primary'>OK</button>
    </>
  )
}

export default Contact
